SELECT * FROM G_PERMISOS
;-- -. . -..- - / . -. - .-. -.--
SELECT * FROM G_USUARIOS A
INNER JOIN G_PERFILES B ON A.Usuario_ID = B.Usuario_ID
INNER JOIN G_GRUPONT C ON B.GGNT_ID = C.GGNT_ID
;-- -. . -..- - / . -. - .-. -.--
SELECT A.Usuario_ID AS Username
    ,C.NOMBRE AS AccessType
, C.NOMBRE AS Role
, CASE C.NOMBRE
      WHEN 'ddocAdmin' THEN 'Administrador'
      ELSE 'No administrador'
    END AS AdminPrivilegeAccount
        FROM G_USUARIOS A
             INNER JOIN G_PERFILES B ON A.Usuario_ID = B.Usuario_ID
             INNER JOIN G_GRUPONT C ON B.GGNT_ID = C.GGNT_ID
;-- -. . -..- - / . -. - .-. -.--
SELECT A.Usuario_ID AS Username
     , C.NOMBRE     AS AccessType
     , C.NOMBRE     AS Role
     , CASE C.NOMBRE
           WHEN 'ddocAdmin' THEN 'Administrador'
           ELSE 'No administrador'
    END             AS AdminPrivilegeAccount
    FROM G_USUARIOS A
             INNER JOIN G_PERFILES B ON A.Usuario_ID = B.Usuario_ID
             INNER JOIN G_GRUPONT C ON B.GGNT_ID = C.GGNT_ID
    ORDER BY A.Usuario_ID
;-- -. . -..- - / . -. - .-. -.--
SELECT A.Usuario_ID AS Username
     , C.NOMBRE     AS AccessType
     , C.NOMBRE     AS Role
     , CASE C.NOMBRE
           WHEN 'ddocAdmin' THEN 'Administrador'
           ELSE 'No administrador'
    END             AS AdminPrivilegeAccount
    FROM G_USUARIOS A
             INNER JOIN G_PERFILES B ON A.Usuario_ID = B.Usuario_ID
             INNER JOIN G_GRUPONT C ON B.GGNT_ID = C.GGNT_ID
    GROUP BY A.Usuario_ID, C.NOMBRE, C.NOMBRE, CASE C.NOMBRE
                                                   WHEN 'ddocAdmin' THEN 'Administrador'
                                                   ELSE 'No administrador'
        END
    ORDER BY A.Usuario_ID
;-- -. . -..- - / . -. - .-. -.--
SELECT A.Usuario_ID AS Username
     , C.NOMBRE     AS AccessType
     , C.NOMBRE     AS Role
     , CASE C.NOMBRE
           WHEN 'ddocAdmin' THEN 'Administrador'
           ELSE 'No es administrador'
    END             AS AdminPrivilegeAccount
    FROM G_USUARIOS A
             INNER JOIN G_PERFILES B ON A.Usuario_ID = B.Usuario_ID
             INNER JOIN G_GRUPONT C ON B.GGNT_ID = C.GGNT_ID
    GROUP BY A.Usuario_ID, C.NOMBRE, C.NOMBRE, CASE C.NOMBRE
                                                   WHEN 'ddocAdmin' THEN 'Administrador'
                                                   ELSE 'No administrador'
        END
    ORDER BY A.Usuario_ID
;-- -. . -..- - / . -. - .-. -.--
SELECT *
    FROM G_USUARIOS A
             INNER JOIN G_PERFILES B ON A.Usuario_ID = B.Usuario_ID
             INNER JOIN G_GRUPONT C ON B.GGNT_ID = C.GGNT_ID
;-- -. . -..- - / . -. - .-. -.--
SELECT A.Usuario_ID AS Username
     , C.NOMBRE     AS AccessType
     , CASE C.NOMBRE
           WHEN 'ddocAdmin' THEN 'Usuario Administrador'
           ELSE 'Usuario Consulta'
    END             AS Role
     , CASE C.NOMBRE
           WHEN 'ddocAdmin' THEN 'Administrador'
           ELSE 'No es administrador'
    END             AS AdminPrivilegeAccount
    FROM G_USUARIOS A
             INNER JOIN G_PERFILES B ON A.Usuario_ID = B.Usuario_ID
             INNER JOIN G_GRUPONT C ON B.GGNT_ID = C.GGNT_ID
    GROUP BY A.Usuario_ID, C.NOMBRE, CASE C.NOMBRE
                                         WHEN 'ddocAdmin' THEN 'Usuario Administrador'
                                         ELSE 'Usuario Consulta'
        END
           , CASE C.NOMBRE
                 WHEN 'ddocAdmin' THEN 'Administrador'
                 ELSE 'No es administrador'
        END
    ORDER BY A.Usuario_ID
