SELECT c.GID
     , C33                                  AS 'Tipo de Documento'
     , C70                                  AS 'No. de Factura'
     , C71                                  AS 'No. de Folio'
     , C72                                  AS '√Årea'
     , C87                                  AS 'Etiqueta'
     , C150                                 AS 'Fecha de Factura'
     , C159                                 AS 'Orden SAP'
     , CONVERT(DATE, A.FECHA_CREACION, 103) AS FECHA_CREACION
     , COUNT(*)                             AS Documentos
    FROM G_CAMPOS_01C0000009 c
             INNER JOIN ddoc_PG.dbo.G_DOCUMENTOS A ON c.GID = A.GID
             INNER JOIN G_PAGINAS B ON A.GID = GID_DOCUMENTO
    WHERE CONVERT(DATE, A.FECHA_CREACION, 103) BETWEEN '2024-07-01' AND '2024-07-31'
    GROUP BY c.GID, C33, C70, C71, C72, C87, C150, C159, CONVERT(DATE, A.FECHA_CREACION, 103)
;-- -. . -..- - / . -. - .-. -.--
SELECT c.GID
     , C33                                  AS 'Tipo de Documento'
     , C70                                  AS 'No. de Factura'
     , C71                                  AS 'No. de Folio'
     , C72                                  AS '√Årea'
     , C87                                  AS 'Etiqueta'
     , C150                                 AS 'Fecha de Factura'
     , C159                                 AS 'Orden SAP'
     , CONVERT(DATE, A.FECHA_CREACION, 103) AS FECHA_CREACION
     , COUNT(*)                             AS Documentos
    FROM G_CAMPOS_01C0000009 c
             INNER JOIN ddoc_PG.dbo.G_DOCUMENTOS A ON c.GID = A.GID
             INNER JOIN G_PAGINAS B ON A.GID = GID_DOCUMENTO
    WHERE CONVERT(DATE, A.FECHA_CREACION, 103) BETWEEN '2024-08-01' AND '2024-08-31'
    GROUP BY c.GID, C33, C70, C71, C72, C87, C150, C159, CONVERT(DATE, A.FECHA_CREACION, 103)
