UPDATE G_DOCUMENTOS
SET COMMITED = 1
WHERE COMMITED = 0 OR COMMITED IS NULL
;-- -. . -..- - / . -. - .-. -.--
SELECT name, log_reuse_wait_desc
    FROM sys.databases
    WHERE name = 'ddoc_PG'
;-- -. . -..- - / . -. - .-. -.--
DECLARE @batchSize INT = 1000;
WHILE (1 = 1)
    BEGIN
        UPDATE TOP (@batchSize) G_DOCUMENTOS
        SET COMMITED = 1
            WHERE COMMITED = 0 OR COMMITED IS NULL;

        IF @@ROWCOUNT = 0 BREAK; -- Salir del bucle cuando no haya m√°s filas para actualizar

        CHECKPOINT; -- Opcionalmente, forzar un vaciado del registro entre lotes para reducir el uso del registro
    END
;-- -. . -..- - / . -. - .-. -.--
