UPDATE GP
SET GP.IMAGENES = GD.PAGINAS
    FROM G_PAGINAS GP
             INNER JOIN G_DOCUMENTOS GD ON GP.GID_DOCUMENTO = GD.GID
;-- -. . -..- - / . -. - .-. -.--
BEGIN
        BEGIN TRANSACTION;

        UPDATE TOP (@batchSize) GP
        SET IMAGENES = GD.PAGINAS
            FROM G_PAGINAS GP
                     INNER JOIN G_DOCUMENTOS GD ON GP.GID_DOCUMENTO = GD.GID
            WHERE GP.IMAGENES IS NULL;  -- O cualquier otra condici√≥n que limite el n√∫mero de filas

        SET @rowsAffected = @@ROWCOUNT;

        COMMIT TRANSACTION;

        -- Esto ayuda a forzar el vaciado del registro de transacciones entre cada lote
        CHECKPOINT;
    END
;-- -. . -..- - / . -. - .-. -.--
